import React from 'react';
import { Paper, withStyles, Grid, TextField, Button, FormControlLabel, Checkbox, Select, MenuItem, InputLabel } from '@material-ui/core';
const styles = theme => ({
    margin: {
        margin: theme.spacing.unit * 2,
    },
    padding: {
        padding: theme.spacing.unit
    }
});

class LoginTab extends React.Component {
    render() {
        const { classes } = this.props;
        return (
            <Paper className={classes.padding}>
                <div className={classes.margin}>
                    <h2 class="text-center">Set AC temperature</h2>
                    <Grid container spacing={8} alignItems="flex-end">
                        <Grid item>
                        </Grid>
                        <Grid item md={true} sm={true} xs={true}>
                            <InputLabel id="label">Lab</InputLabel>
                            <Select>
                                <MenuItem value="lab1">Lab 1</MenuItem>
                                <MenuItem value="lab2">Lab 2</MenuItem>
                                <MenuItem value="lab3">Lab 3</MenuItem>
                            </Select>
                        </Grid>
                    </Grid>
                </div>
            </Paper>
        );
    }
}

export default withStyles(styles)(LoginTab);
